// NavigationBar.js

import React from 'react';
import { Link } from 'react-router-dom';
import AuthService from '../../authService'; // Make sure to import AuthService

import './styles.css'; // Import the separate CSS file for navigation bar styling

const NavigationBar = () => {
  // Check if the user is logged in
  const isLoggedIn = AuthService.isAuthenticated();

  return (
    <div className="navbar-container">
      <div className="navbar-form">
        <ul className="nav-list">
          <li><Link to="/">Home</Link></li>
          <li><Link to="/electionslist">Check Your Elections</Link></li>
          <li><Link to="/create">Create Election</Link></li>
          <li><Link to="/check-applications">Check Your Election Applications</Link></li>
          <li><Link to="/electionsreg">Register to Election</Link></li>
          {isLoggedIn ? (
            <>
              <li><Link to="/logout">Logout</Link></li>
              {/* Add other navigation links for logged-in users */}
            </>
          ) : (
            <>
              <li><Link to="/login">Login</Link></li>
              <li><Link to="/register">Register</Link></li>
              {/* Add other navigation links for non-logged-in users */}
            </>
          )}
        </ul>
      </div>
    </div>
  );
};

export default NavigationBar;
